import React from 'react';
import { Text, View, Pressable, Image } from 'react-native';
import { useStyles } from '../../lib/style/useStyle';
import { useSafeAreaInsets } from 'react-native-safe-area-context';
import PixelImage from '../../Components/common/PixelImage';
import { pixelSizeVertical, pixelSizeHorizontal, fontPixel, heightPixel, widthPixel } from '../../lib/style/adjust';
import { useNavigation } from '@react-navigation/native';
const CustomizeDiary = () => {
    const commonStyle = useStyles();
    const insets = useSafeAreaInsets();

    const navigation = useNavigation();
    return (
        <View
            style={{
                paddingTop: 0,
                paddingBottom: 0,
                flex: 1,
                backgroundColor: '#FFFFFF',
            }}>

            <View style={{ marginTop: pixelSizeVertical(10) }}>
                <PixelImage
                    imageSource={require('../../../assets/attornea.png')}
                    imageWidth={150}
                />
            </View>
            <View style={{
                alignSelf: 'center'
            }}>
                <PixelImage
                    imageSource={require('../../../assets/icons/Lawyer-Attornea-5.png')}
                    imageWidth={250}
                />
            </View>
            <View
                style={{
                    display: 'flex',
                    flexDirection: 'row',
                    width: '70%',
                    alignItems: 'center',
                    // alignSelf: 'center'
                }}>

                <PixelImage
                    imageSource={require('../../../assets/icons/Lawyer-.png')}
                    imageWidth={100}
                />
                <Text
                    style={

                        {
                            color: '#29406C',
                            fontWeight: 'bold',
                            letterSpacing: pixelSizeHorizontal(2),
                            fontSize: fontPixel(28),
                            textAlign: 'center',
                        }
                    }>
                    Customize your Digital Diary
                </Text>
            </View>
            <View style={{
                width: '70%',
                alignSelf: 'center'
            }}>
                <Text style={

                    {
                        top: '5%',
                        color: '#29406C',
                        fontSize: fontPixel(22),
                        textAlign:'justify'
                    }
                }>Sign up and create your personalized digital diary now. Keep yourself updated by regular reminder and notes     </Text>
                <Pressable
                    style={{
                        flexDirection: 'row',
                        backgroundColor: '#20496c',
                        borderColor: 'rgba(242, 242, 242, 0.5)',
                        borderWidth: 2,
                        width: '100%',
                        height: heightPixel(52),
                        borderRadius: heightPixel(26),
                        alignItems: 'center',
                        justifyContent: 'center',
                        marginTop: heightPixel(50),
                    }}
                    onPress={() => { navigation.navigate('Auth') }} >
                    <Text
                        style={{
                            color: '#fff',
                            fontWeight: '600',
                            fontSize: fontPixel(20),
                            textAlign: 'center',
                            letterSpacing: 2
                        }
                        }>
                        Get Started Now
                    </Text>
                </Pressable>
            </View>


        </View>
    );
};

export default CustomizeDiary;
